import React, { useState, useEffect } from 'react';
import './ServiceBooking.css';
import axios from 'axios';
import { LocalizationProvider } from '@mui/x-date-pickers';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import TextField from '@mui/material/TextField';

const ServiceBooking = ({ selectedService = '', setSelectedService }) => {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    service_type: selectedService,
    preferred_date: '',
    message: '',
  });

  const [submitted, setSubmitted] = useState(false);
  const [ticketId, setTicketId] = useState('');
  const [error, setError] = useState('');
  const [dateObject, setDateObject] = useState(null);

  useEffect(() => {
    setFormData((prev) => ({
      ...prev,
      service_type: selectedService,
    }));
  }, [selectedService]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name === 'service_type' && setSelectedService) {
      setSelectedService(value);
    }
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setTicketId('');

    const token = localStorage.getItem('access_token');
    if (!token) {
      setError('⚠️ You must be logged in to book a service.');
      return;
    }

    if (!dateObject || dateObject < new Date().setHours(0, 0, 0, 0)) {
      setError('Please select a valid future date.');
      return;
    }

    try {
      const response = await axios.post(
        'http://localhost:8000/api/bookings/',
        {
          ...formData,
          preferred_date: dateObject.toISOString().split('T')[0],
        },
        {
          headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json',
          },
        }
      );

      setSubmitted(true);
      setTicketId(response.data.ticket_id);
      console.log('✅ Booking submitted successfully:', response.data);
    } catch (error) {
      console.error('❌ Booking submission failed:', error);
      if (error.response) {
        const message = error.response.data?.message || 'Booking submission failed.';
        setError(`Submission failed: ${Array.isArray(message) ? message.join(', ') : message}`);
      } else {
        setError('An unexpected error occurred. Please try again.');
      }
    }
  };

  return (
    <div className="book-service-form">
      <h2>Book a Smart Home Service</h2>
      {submitted ? (
        <div className="success-message">
          <p>✅ Thank you! Your service ticket has been created.</p>
          <p><strong>Ticket ID:</strong> {ticketId}</p>
        </div>
      ) : (
        <form onSubmit={handleSubmit}>
          <input
            name="name"
            placeholder="Name"
            onChange={handleChange}
            value={formData.name}
            required
          />
          <input
            name="phone"
            placeholder="Phone"
            onChange={handleChange}
            value={formData.phone}
            required
          />

          <select
            name="service_type"
            value={formData.service_type}
            onChange={handleChange}
            required
          >
            <option value="" disabled>Select Service Type</option>
            <option value="Basic Package">Basic Package</option>
            <option value="Plus Package">Plus Package</option>
            <option value="Full Automation">Full Automation</option>
          </select>

          {/* 🚀 Pro Date Picker (MUI) */}
          <LocalizationProvider dateAdapter={AdapterDateFns}>
            <DatePicker
              label="Preferred Date"
              value={dateObject}
              onChange={(newDate) => setDateObject(newDate)}
              disablePast
              inputFormat="yyyy-MM-dd"
              renderInput={(params) => (
                <TextField
                  {...params}
                  required
                  fullWidth
                  margin="normal"
                  name="preferred_date"
                />
              )}
            />
          </LocalizationProvider>

          <textarea
            name="message"
            placeholder="Additional Message (Optional)"
            onChange={handleChange}
            value={formData.message}
          />
          <button type="submit">Submit</button>
          {error && (
            <p className="error-message" style={{ color: '#F44336', marginTop: '15px' }}>
              {error}
            </p>
          )}
        </form>
      )}
    </div>
  );
};

export default ServiceBooking;
